import {Link,Route,Routes} from 'react-router-dom';
import App from "../App";
import AddAntique from "./AddAntique";
import AntiqueTable from "./ATable/AntiqueTable";
export default function RoutePaths(){

    return (
        <Routes>
            {/* <Route exact path='/' element={<App.js />} /> */}
            <Route path="/antiques/AddAntique" element={<AddAntique.js />} />
            <Route path="/antiques" element={<AntiqueTable.js />} />
            
            {/* <Route path='/' element={<App.js />} /> */}
            {/* <Route path='/' element={<App.js />} /> */}
        </Routes>
    )
}
